import React from 'react';
import { Button, Modal, Input } from 'antd';
import 'antd/dist/reset.css';
import "./Recuperar3.css";

export const Recuperar3 = ({ isVisible, closeModal }) => {

  const [isModalVisible, setIsModalVisible] = React.useState(isVisible);

  React.useEffect(() => {
    setIsModalVisible(isVisible);
  }, [isVisible]);

  return (
    <>
      <Modal
        title="Recuperar Contraseña"
        centered
        open={isModalVisible}
        onCancel={closeModal}
        footer={null}
        className='modal_recuperar3'
      >
        <div className="div">
          <p className='text'>Ingrese su nueva contraseña</p>
        </div>

        <Input className='input' placeholder='Nueva Contraseña'></Input>
        <Input className='input' placeholder='Confirmar Contraseña'></Input>
        <Button className='boton_enviar'>Cambiar Contraseña</Button>
      </Modal>
    </>
  );
};

export default Recuperar3;
